
<html>
 <head>
  <title>JSxCAD Viewer</title>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, user-scalable=no, minimum-scale=1.0, maximum-scale=1.0">
  <style>
    div.book {
      height: 100%;
      overflow: scroll;
      margin-left: 20px;
      display: flex;
      flex-wrap: wrap;
      align-content: flex-start;
      justify-content: flex-start;
    }

    div.note.card {
      border: 1px dashed crimson;
      margin: 4px 4px;
      padding: 4px 4px;
      display: inline-block;
      width: fit-content;
      height: fit-content;
    }

    .note.log {
      font-family: "Arial Black", Gadget, sans-serif;
      color: red
    }

    .note.view {
      border: 1px dashed dodgerblue;
      margin: 4px 4px;
      padding: 4px 4px;
    }

    .note.orbitView {
      position: absolute;
      top: 0;
      width: 100%;
      height: 100%;
      z-index: 10000;
    }

    button.note.download {
      border: 2px solid black;
      border-radius: 5px;
      background-color: white;
      margin: 4px 4px;
      padding: 10px 24px;
      font-size: 16px;
      cursor: pointer;
      border-color: #2196F3;
      color: dodgerblue
    }

    button.note.download:hover {
      background: #2196F3;
      color: white;
    }

    .note th,td {
      border: 1px solid dodgerblue;
      padding: 5px;
    }
  </style>
  <script src="https://cdn.jsdelivr.net/npm/mermaid/dist/mermaid.min.js"></script>
 </head>
 <body>
  <script type='module'>
    import api from 'https://jsxcad.js.org/alpha/jsxcad-api.js';
    import { Shape } from 'https://jsxcad.js.org/alpha/jsxcad-api-shape.js';
    import { dataUrl } from 'https://jsxcad.js.org/alpha/jsxcad-ui-threejs.js';
    import { addOnEmitHandler, boot, read, removeOnEmitHandler, resolvePending, setupWorkspace, write } from 'https://jsxcad.js.org/alpha/jsxcad-sys.js';
    import { getNotebookControlData, toDomElement } from 'https://jsxcad.js.org/alpha/jsxcad-ui-notebook.js';

    const baseUrl = "https://jsxcad.js.org";
    const module = "nb/projects/pentacular/bear/bear.nb";
    const workspace = 'JSxCAD';

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async ({ isRerun = false } = {}) => {
      const topLevel = new Map();
      const seenHashes = new Set();
      const notebook = [];
      const addNotes = (notes) => {
        for (const note of notes) {
          if (seenHashes.has(note.hash)) {
            continue;
          }
          seenHashes.add(note.hash);
          notebook.push(note);
        }
      }
      const onEmitHandler = addOnEmitHandler(addNotes);

      if (isRerun) {
        const notebookControlData = await getNotebookControlData();
        await write('control/' + module, notebookControlData, {
          workspace,
        });
      }

      await api.importModule(module, {
        clearUpdateEmits: true,
        topLevel,
        readCache: false,
        workspace,
      });

      await resolvePending();

      for (const note of notebook) {
        const { path, data, hash } = note;
        if (path && !data) {
          // We should configure this case to be already embedded.
           note.data = await read(path);
        }
        if (note.md) {
          note.md = note
            .md
            .replace(/#https:\/\/raw.githubusercontent.com\/jsxcad\/JSxCAD\/master\/(.*?).nb/g, (_, modulePath) => baseUrl + '/' + modulePath + '.html');
        }
      }

      const body = document.getElementsByTagName('body')[0];
      {
        const oldBookElement = document.getElementById('bookElement')
        if (oldBookElement) {
          oldBookElement.remove();
        }
      }
      const bookElement = document.createElement('div');
      bookElement.id = 'bookElement';
      const notebookElement = await toDomElement(await prepareViews(notebook), { useControls: true });
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');

      removeOnEmitHandler(onEmitHandler);
    };

    const onKeyDown = (e) => {
      const CONTROL = 17;
      const E = 69;
      const ENTER = 13;
      const S = 83;
      const SHIFT = 16;

      const key = e.which || e.keyCode || 0;

      switch (key) {
        case CONTROL:
        case SHIFT:
          return true;
      }

      const { ctrlKey, shiftKey } = e;
      switch (key) {
        case ENTER: {
          if (shiftKey) {
            e.preventDefault();
            e.stopPropagation();
            run({ isRerun: true });
            return false;
          }
          break;
        }
      }
    };

    const start = async () => {
      setupWorkspace(workspace);
      await boot();

      // Construct a local ephemeral filesystem.
      const files = JSON.parse(decodeURIComponent("%7B%22source%2Fnb%2Fprojects%2Fpentacular%2Fbear%2Fbear.nb%22%3A%22md%60%23%23%23%20Bear%20model%20sliced%60%3B%5Cn%5Cnconst%20url%20%3D%20control('url'%2C%20'https%3A%2F%2Fjsxcad.js.org%2Fstl%2Fbear.stl'%2C%20'input')%3B%5Cnconst%20height%20%3D%20control('height'%2C%20200%2C%20'input')%3B%5Cnconst%20spacing%20%3D%20control('spacing'%2C%202%2C%20'input')%3B%5Cn%5Cnconst%20a%20%3D%20(await%20readStl(url)).by(align('z%3E'))%3B%5Cn%5Cna.stl('bear').note('This%20is%20a%20low-poly%20model%20of%20a%20bear.')%3B%5Cna.section(seq(%7B%20to%3A%20height%2C%20by%3A%20spacing%20%7D%2C%20XY%2C%20Group))%5Cn%20%20.note(%60Stl%20sliced%20each%20%24%7Bspacing%7Dmm%20up%20to%20%24%7Bheight%7Dmm.%60)%5Cn%20%20.view()%5Cn%20%20.note('Laid%20out%20on%20a%20single%20sheet%20for%20cutting.')%5Cn%20%20.pdf('slices'%2C%20each(flat()).page('pack'))%3B%5Cn%22%2C%22source%2Fhttps%3A%2F%2Fjsxcad.js.org%2Fstl%2Fbear.stl%22%3A%22solid%20JSxCAD%5Cnfacet%20normal%200.4052022833809907%20-0.9092620465085497%20-0.0951506191357449%5Cnouter%20loop%5Cnvertex%20-8.2222%20-12.00411%202.14445%5Cnvertex%20-10.5565%20-12.81511%20-0.04631%5Cnvertex%20-9.6977%20-12.44592%200.08293%5Cnendloop%5Cnendfacet%5Cnfacet%20normal%200.771659156689868%20-0.6172021062519258%20-0.153634976274506%5Cnouter%20loop%5Cnvertex%20-9.6977%20-12.44592%200.08293%5Cnvertex%20-9.58709%20-12.3%200.05228%5Cnvertex%20-9.48191%20-12.17446%200.07623%5Cnendloop%5Cnendfacet%5Cnfacet%20normal%200.7165413994305102%20-0.5791900382370874%20-0.3887252532433252%5Cnouter%20loop%5Cnvertex%20-9.6977%20-12.44592%200.08293%5Cnvertex%20-9.48191%20-12.17446%200.07623%5Cnvertex%20-8.2222%20-12.00411%202.14445%5Cnendloop%5Cnendfacet%5Cnfacet%20normal%200.23250334110315027%20-0.20827056357648718%20-0.950034509227641%5Cnouter%20loop%5Cnvertex%20-9.6977%20-12.44592%200.08293%5Cnvertex%20-10.5565%20-12.81511%20-0.04631%5Cnvertex%20-9.48191%20-12.17446%200.07623%5Cnendloop%5Cnendfacet%5Cnfacet%20normal%20-0.7716
